import React from 'react';


const ImageCard = ({ imgSrc, onClick }) => {
  return (
    <div className="image-card" onClick={onClick}>
      <img src={imgSrc} alt="Gallery" className="gallery-img" loading="lazy" />
    </div>
  );
};

export default ImageCard;
